import React from "react";

export default function QuestionCard(props) {
  return (
    <div className="container bg-light p-3 mb-2 mt-2 rounded border border-success">
      <span className="badge text-bg-primary ml-2">Question 1</span>
      {props.quesprop.question[0]}

      <div className="container mb-2 mt-2">
        <div className="row">
          <div className="col border border-dark">opt 1</div>
          <div className="col border border-dark">opt 2</div>
          <div className="col border border-dark">opt 3</div>
          <div className="col border border-dark">opt 4</div>
        </div>
      </div>

      <div className="container  mb-2 mt-2">
        <span className="badge rounded-pill text-bg-success">Answer : </span>
      </div>
    </div>
  );
}
